import s from './nav-bar.module.css'
import ToolBar from "./ToolBar/toolBar";

const Navbar = (props) => {
    return (
        <nav className={s.nav}>
            <ToolBar addressElement={props.addressElement}/>
        </nav>
    );
};

export default Navbar;
